import React from 'react'
import './DBTBox.css'

function DBTBox() {
  return (
    <div class="dbt-box">
        {/* Upper part show data */}
        <div >
            <h4>ม.กรุงเทพดีแค่โฆษณา</h4>
        </div>
        <div>
            <button class="debate-button">ดีเบต</button>
        </div>

    </div>
  )
}

export default DBTBox
